import React from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import NavBar from './component/NavBar';
import Sidebar from './component/Sidebar/Sidebar';
import Login from './component/Login';
import Logout from './component/Logout';
import Register from './component/Register';
import ForgetPs from './component/ForgetPs';
import Dashboard from './component/Dashboard/Dashboard';
import DoughnutChart from './component/Dashboard/DoughnutChart';
import Dclass from './component/Sidebar/Dclass';
import Syllubus from './component/Sidebar/Syllubus';
import Task from './component/Sidebar/Task';
import TasksSubmission from './component/Sidebar/TasksSubmission';
import useContent from './useContent'; // Import the useContent hook

const App = () => {
    // Fetch authentication status and functions from useContent hook
    const { isAuthenticated, handleLogin, handleLogout } = useContent();

    return (
        <Router>
            <Routes>
                {/* Route for the homepage */}
                <Route
                    path="/"
                    element={
                        // If user is authenticated, redirect to the dashboard; otherwise, show the login page
                        isAuthenticated ? <Navigate to="/dashboard" /> : <Login handleLogin={handleLogin} navigate={navigate} />
                    }
                />

                {/* Other routes */}
                <Route path="/login" element={<Login handleLogin={handleLogin} navigate={navigate} />} />
                <Route path="/register" element={<Register />} />
                <Route path="/forgetps" element={<ForgetPs />} />
                <Route path="/logout" element={<Logout handleLogout={handleLogout} navigate={navigate} />} />

                {/* Authenticated routes - rendered only when authenticated */}
                {isAuthenticated ? (
                    <Route element={<AuthenticatedRoutes handleLogout={handleLogout} navigate={navigate} />} />
                ) : null}
            </Routes>
        </Router>
    );
};

// Component to render authenticated routes
const AuthenticatedRoutes = ({ handleLogout, navigate }) => {
    const [isSidebarOpen, setIsSidebarOpen] = useState(false);

    // Function to toggle the sidebar
    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen);
    };

    // Existing code for the effect

    return (
        <div id="layoutSidenav">
            <nav>
                {/* Render the navigation bar */}
                <NavBar toggleSidebar={toggleSidebar} handleLogout={handleLogout} navigate={navigate} />
            </nav>
            <div id="layoutSidenav_nav">
                {/* Render the sidebar based on isSidebarOpen state */}
                {isSidebarOpen && <Sidebar />}
            </div>

            <div id="layoutSidenav_content">
                <Routes>
                    {/* Define various routes for authenticated user */}
                    <Route path="/" element={<Dashboard />} />
                    <Route path="/dashboard" element={<Dashboard />} />
                    <Route path="/donut" element={<DoughnutChart />} />
                    <Route path="/class" element={<Dclass />} />
                    <Route path="/task" element={<Task />} />
                    <Route path="/tasksubmit" element={<TasksSubmission />} />
                    <Route path="/syllubus" element={<Syllubus />} />
                </Routes>
            </div>
        </div>
    );
};

export default App;
